import React, { useState } from "react";
import { Line } from "react-chartjs-2";
import Navbar from "../homepage/Navbar";
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
} from "chart.js";

// âœ… Register necessary chart components
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

// ðŸ”¹ Mock Data for Price Trends
const mockData = [
    { district: "Woodlands", year: 2010, price: 320000 },
    { district: "Woodlands", year: 2015, price: 380000 },
    { district: "Woodlands", year: 2020, price: 420000 },
    { district: "Bishan", year: 2010, price: 550000 },
    { district: "Bishan", year: 2015, price: 620000 },
    { district: "Bishan", year: 2020, price: 680000 },
    { district: "Tampines", year: 2010, price: 430000 },
    { district: "Tampines", year: 2015, price: 500000 },
    { district: "Tampines", year: 2020, price: 570000 },
];

const Insights = () => {
    const [selectedDistrict, setSelectedDistrict] = useState("Woodlands");

    // âœ… Filter Data for Selected District
    const filteredData = mockData.filter((d) => d.district === selectedDistrict);

    // ðŸ“Š Prepare Data for Line Chart
    const lineChartData = {
        labels: filteredData.map((d) => d.year),
        datasets: [
            {
                label: `Resale Prices in ${selectedDistrict}`,
                data: filteredData.map((d) => d.price),
                borderColor: "rgb(75, 192, 192)",
                backgroundColor: "rgba(75, 192, 192, 0.2)",
                borderWidth: 2,
                pointRadius: 5,
                pointBackgroundColor: "rgb(75, 192, 192)",
            },
        ],
    };

    // ðŸ“Œ Line Chart Options (NO ANIMATION)
    const lineChartOptions = {
        responsive: true,
        maintainAspectRatio: false,
        plugins: {
            legend: { display: true },
            title: { display: true, text: "HDB Resale Price Trends" },
        },
        animation: false, // âœ… No animation, instant updates
        scales: {
            y: {
                beginAtZero: false,
                suggestedMin: 200000,
                suggestedMax: 1000000,
            },
            x: { grid: { display: false } },
        },
    };

    // ðŸ”® AI-Powered Prediction for Future Prices
    const lastPrice = filteredData[filteredData.length - 1].price;
    const predictedPrice = (lastPrice * 1.15).toFixed(2); // ðŸ”¼ Predicts a 15% increase in 5 years

    // ðŸ“‰ Market Trend Indicator
    const priceDifference = filteredData.length > 1
        ? filteredData[filteredData.length - 1].price - filteredData[0].price
        : 0;

    const trendMessage = priceDifference > 0
        ? `ðŸ“ˆ Prices in ${selectedDistrict} have increased by $${priceDifference.toLocaleString()} since ${filteredData[0].year}.`
        : `ðŸ“‰ Prices in ${selectedDistrict} have decreased by $${Math.abs(priceDifference).toLocaleString()} since ${filteredData[0].year}.`;

    return (
        <div className="min-h-screen bg-gray-100 text-red-900">
            <Navbar />
            <div className="max-w-5xl mx-auto mt-10 px-6">
                <h1 className="text-4xl font-bold text-center mb-6">ðŸ“Š AI-Powered Insights & Trends</h1>

                {/* ðŸ“Œ Select District Dropdown */}
                <div className="flex justify-center mb-6">
                    <label className="font-semibold mr-2">Choose a District:</label>
                    <select
                        value={selectedDistrict}
                        onChange={(e) => setSelectedDistrict(e.target.value)}
                        className="border px-4 py-2 rounded-lg"
                    >
                        <option value="Woodlands">Woodlands</option>
                        <option value="Bishan">Bishan</option>
                        <option value="Tampines">Tampines</option>
                    </select>
                </div>

                {/* ðŸ“Š Price Trend Graph */}
                <div className="bg-white p-6 shadow-md rounded-lg">
                    <h2 className="text-xl font-semibold mb-4">ðŸ“ˆ Resale Price Trend</h2>
                    <div className="h-80">
                        <Line data={lineChartData} options={lineChartOptions} />
                    </div>
                </div>

                {/* ðŸ”® AI-Powered Future Prediction */}
                <div className="mt-6 bg-white p-6 shadow-md rounded-lg">
                    <h2 className="text-xl font-semibold mb-4">ðŸ”® AI-Powered Prediction</h2>
                    <p className="text-gray-700">
                        ðŸš€ **Estimated 2025 Resale Price in {selectedDistrict}:**  
                        <span className="text-green-600 font-bold">
                            ${predictedPrice}
                        </span>
                    </p>
                    <p className="text-gray-700 mt-2">
                        ðŸ“‰ **Best Time to Buy:** Based on past trends, prices increase by **15% every 5 years.**  
                        Buying **now** could be a smart move!
                    </p>
                </div>

                {/* ðŸ“ˆ Market Trend Message */}
                <div className="bg-white p-6 shadow-md rounded-lg mt-6 text-center">
                    <h2 className="text-xl font-semibold mb-2">ðŸ“Š Market Trend</h2>
                    <p className={priceDifference > 0 ? "text-green-600 font-bold" : "text-red-600 font-bold"}>
                        {trendMessage}
                    </p>
                </div>
            </div>
        </div>
    );
};

export default Insights;
